USE JewelryStore
GO

CREATE TABLE dbo.orderdetail (
    orderdetail_id BIGINT IDENTITY(1,1) NOT NULL,
    quantity INT NULL,
    unitprice FLOAT NULL,
    order_id BIGINT NULL,
    product_id BIGINT NULL,
    PRIMARY KEY CLUSTERED (orderdetail_id ASC)
)
GO

CREATE TABLE dbo.orders (
    order_id BIGINT IDENTITY(1,1) NOT NULL,
    purchase_date DATETIME2(7) NULL,
    status_order NVARCHAR(255) NULL,
    total_price FLOAT NULL,
    user_id BIGINT NULL,
    PRIMARY KEY CLUSTERED (order_id ASC)
)
GO

CREATE TABLE dbo.product (
    product_id BIGINT IDENTITY(1,1) NOT NULL,
    product_description NVARCHAR(255) NULL,
    product_image VARBINARY(MAX) NULL,
    product_price FLOAT NULL,
    product_name NVARCHAR(255) NULL,
    product_quantity INT NULL,
    category_id BIGINT NULL,
    sale_id BIGINT NULL,
    PRIMARY KEY CLUSTERED (product_id ASC)
)
ON [PRIMARY]
GO

CREATE TABLE dbo.productcategory (
    category_id BIGINT IDENTITY(1,1) NOT NULL,
    category_name NVARCHAR(255) NULL,
    PRIMARY KEY CLUSTERED (category_id ASC)
)
GO

CREATE TABLE dbo.role (
    role_id BIGINT IDENTITY(1,1) NOT NULL,
    role_name NVARCHAR(255) NULL,
    PRIMARY KEY CLUSTERED (role_id ASC)
)
GO

CREATE TABLE dbo.sale (
    sale_id BIGINT IDENTITY(1,1) NOT NULL,
    sale_percent INT NULL,
    PRIMARY KEY CLUSTERED (sale_id ASC)
)
GO

CREATE TABLE dbo.users (
    user_id BIGINT IDENTITY(1,1) NOT NULL,
    address NVARCHAR(255) NULL,
    avatar VARBINARY(MAX) NULL,
    birth_day DATETIME2(7) NULL,
    email VARCHAR(255) NULL,
    password VARCHAR(255) NULL,
    phone VARCHAR(255) NULL,
    sex BIT NULL,
    user_name NVARCHAR(255) NULL,
    verify BIT NULL,
    role_id BIGINT NULL,
    PRIMARY KEY CLUSTERED (user_id ASC)
)
ON [PRIMARY]
GO

